pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "./interfaces/IPool.sol";
import "./interfaces/IRouter01.sol";
import "./interfaces/IRouter02.sol";
import "./interfaces/IFactory.sol";
import "./interfaces/IWETH.sol";
import "./interfaces/IPoolCallback.sol";
import "./Multicall.sol";

contract Router is IRouter01, IRouter02, IPoolCallback, Multicall {
    fallback() external {}
    receive() payable external {}

    using SafeERC20 for IERC20;

    address public _factory;
    address public _wETH;

    constructor(address factory, address wETH) {
        _factory = factory;
        _wETH = wETH;
    }

    function poolCallback(
        uint256 amount,
        address payToken,
        address payer
    ) external override payable {
        IFactory factory = IFactory(_factory);
        require(factory.pools(msg.sender), "caller is not the pool");

        if (payToken == _wETH && address(this).balance >= amount) {
            IWETH wETH = IWETH(_wETH);
            wETH.deposit{value: amount}();
            wETH.transfer(msg.sender, amount);
        } else {
            IERC20(payToken).safeTransferFrom(payer, msg.sender, amount);
        }
    }

    function getPrice(address pool) external override view returns (uint256) {
        return IPool(pool).getPrice();
    }

    function submit(address pool, uint256 margin, int16 level) external override {
        IPool(pool).submit(msg.sender, margin, level);
    }

    function open(address pool, uint256 deadLine) external override {
        IPool(pool).open(msg.sender, deadLine);
    }

    // function open(address pool, uint256 margin, int16 level) external override {
    //     IPool(pool).open(msg.sender, margin, level);
    // }

    function close(address pool, uint32 index, address receipt) external override {
        IPool(pool).close(index, msg.sender, receipt);
    }

    function liquidate(address pool, uint32 index, address receipt) external override {
        IPool(pool).liquidate(msg.sender, index, receipt);
    }

    function withdrawERC20(address payToken) external override {
        IERC20 erc20 = IERC20(payToken);
        uint256 balance = erc20.balanceOf(address(this));
        require(balance > 0, "balance of router must > 0");
        erc20.safeTransfer(msg.sender, balance);
    }

    function withdrawETH() external override {
        uint256 balance = IERC20(_wETH).balanceOf(address(this));
        require(balance > 0, "balance of router must > 0");
        IWETH(_wETH).withdraw(balance);
        (bool success, ) = msg.sender.call{value: balance}(new bytes(0));
        require(success, "ETH transfer failed");
    }

}
